DROP TABLE IF EXISTS Drug_Alcohol;
CREATE TABLE Drug_Alcohol(
   `Year`                  INTEGER  NOT NULL
  ,`State`                 VARCHAR(20)
  ,`Drug_Alcohol_Induced`  VARCHAR(41) NOT NULL
  ,`Deaths`                INTEGER 
  ,`Population`            INTEGER 
  ,`Crude_Rate`            VARCHAR(10)
  ,`Total_Deaths_percentage` VARCHAR(7)
);
